import Vue from 'vue';
import App from './App.vue';
import axios from 'axios';

axios.defaults.baseURL = 'http://localhost:3000'; // Puerto en el que NestJS está corriendo

Vue.config.productionTip = false;

new Vue({
  render: h => h(App),
}).$mount('#app');
